						["check"] = "event",
						["custom"] = "function(allstates, event, ...)\n    local consumes = aura_env.consumes\n    \n    for consume,reqAmount in pairs(consumes) do\n        \n        --print(consume, reqAmount)\n        allstates[consume] = allstates[consume] or {} -- error checking\n        \n        local state = allstates[consume]\n        \n        local name, _, _, _, _, _, _, _,_, icon = GetItemInfo(consume)\n        local currentAmount = GetItemCount(consume,false,false)\n        \n        if aura_env.config.shortnametoggle and name then\n            local clientLanguage = GetLocale();\n            local shortName1;\n            local shortName2;\n            local shortName3;\n            local shortName4;\n            local shortName5;\n            local shortName6;\n            local shortName;\n            if clientLanguage == \"deDE\" then\n                shortName1 = name:gsub(\"Elixier der\",\"El. d.\")\n                shortName2 = shortName1:gsub(\"Begrenzter\",\"Begr.\") \n                shortName3 = shortName2:gsub(\"Fläschchen\",\"Fl.\")\n                shortName4 = shortName3:gsub(\"Schwerer\",\"Schw.\")\n                shortName5 = shortName4:gsub(\"trank\",\"tr.\")\n                shortName6 = shortName5:gsub(\"Trank\",\"Tr.\")\n                shortName = shortName6:gsub(\"(%S+) \",function(t) return t:sub(1,14)..\" \" end)\n            elseif clientLanguage == \"frFR\" then\n                shortName1 = name:gsub(\"Potion\",\"Pot.\")\n                shortName2 = shortName1:gsub(\"supérieure\",\"sup.\") \n                shortName3 = shortName2:gsub(\"Elixir\",\"El.\")\n                shortName4 = shortName3:gsub(\"limitée\",\"lim.\")\n                shortName5 = shortName4:gsub(\"Bandage épais en étoffe runique\",\"Band. ép. en étoffe run.\")\n                shortName6 = shortName5:gsub(\"supérieur\",\"sup.\") \n                shortName = shortName6:gsub(\"(%S+) \",function(t) return t:sub(1,14)..\" \" end)\n            else\n                shortName1 = name:gsub(\"Greater\",\"Gr.\")\n                shortName2 = shortName1:gsub(\"Protection \",\"Prot.\") \n                shortName3 = shortName2:gsub(\"Invulnerability\",\"Invuln.\")\n                shortName4 = shortName3:gsub(\"Runecloth\",\"Runecl.\")\n                shortName5 = shortName4:gsub(\"Potion\",\"Pot.\")\n                shortName = shortName5:gsub(\"(%S+) \",function(t) return t:sub(1,14)..\" \" end)\n            end\n            state.name = shortName:gsub(\"(%S+)%.(%S+)$\",\"%1. %2\")\n        else\n            state.name = name\n        end\n        \n        state.icon = icon\n        state.progressType = 'static'\n        state.value = currentAmount\n        state.total = reqAmount\n        state.autoHide = true\n        state.show = true\n        if(reqAmount <= 0) then\n            state.show =false\n        end\n        state.completed = currentAmount >= reqAmount\n        state.twothirds = currentAmount < reqAmount and currentAmount >= ((reqAmount/3)*2)\n        state.half = currentAmount <= (reqAmount/2)\n        state.none = currentAmount == 0\n        \n        if aura_env.config.sortingmethod == 2 then\n            state.index = reqAmount;\n        elseif aura_env.config.sortingmethod == 3 then\n            state.index = -reqAmount;\n        else\n            state.index = name;\n        end\n        state.changed = true\n    end\n    \n    return true\nend",
