		["LFG Chat Filter"] = {
			["outline"] = "THICKOUTLINE",
			["xOffset"] = 375,
			["displayText"] = "%c\n",
			["customText"] = "function()    \n    \n    if aura_env.config[\"display_lfg\"] == true then\n        dsp_lfg = \"True\"\n    else\n        dsp_lfg = \"False\"\n    end\n    \n    aura_env.finaltextstr = \"LFG-Chatfilter:\\nDisplay LFG-messages: \" .. dsp_lfg .. \"\\nPhrases: \" .. aura_env.search_str .. \"\\nMessages: (\" .. aura_env.message_list_index - 1 .. \" / \" .. aura_env.config[\"maxLineNo\"] ..  \")\\n\\n\"\n    \n    for index, entry in pairs(aura_env.message_list) do\n        aura_env.finaltextstr = aura_env.finaltextstr .. entry\n    end\n    \n    return aura_env.finaltextstr \nend\n\n\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/8A7RTyMQg/1",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.message_list_index = 1\naura_env.message_list = {}\naura_env.finaltextstr = \"\"\naura_env.search_list = {}\naura_env.search_str = \"\"\n\naura_env.search_phrases_dung_list = {\"BRD\", \"LBRS\", \"UBRS\", \"STRAT\", \"SCHOLO\"}\naura_env.search_phrases_raid_list = {\"MC\", \"ONY\", \"AQ40\", \"NAXX\"}\n\n\n-- create empty message list\nfor i = 1, aura_env.config[\"maxLineNo\"] do\n    table.insert(aura_env.message_list, \"\\n\")\nend\n\n-- create search_list\n-- Dungeons\nfor index, entry in pairs(aura_env.config[\"search_phrases\"][\"search_phrases_dung\"]) do\n    if entry == true then\n        table.insert(aura_env.search_list, aura_env.search_phrases_dung_list[index])\n    end\nend\n\n-- Raids\nfor index, entry in pairs(aura_env.config[\"search_phrases\"][\"search_phrases_raid\"]) do\n    if entry == true then\n        table.insert(aura_env.search_list, aura_env.search_phrases_raid_list[index])\n    end\nend\n\n-- Custom\nif aura_env.config[\"search_phrases\"][\"search_phrases_custom1\"] ~= \"\" then\n    table.insert(aura_env.search_list, aura_env.config[\"search_phrases\"][\"search_phrases_custom1\"])\nend\n\nif aura_env.config[\"search_phrases\"][\"search_phrases_custom2\"] ~= \"\" then\n    table.insert(aura_env.search_list, aura_env.config[\"search_phrases\"][\"search_phrases_custom2\"])\nend\n\nif aura_env.config[\"search_phrases\"][\"search_phrases_custom3\"] ~= \"\" then\n    table.insert(aura_env.search_list, aura_env.config[\"search_phrases\"][\"search_phrases_custom3\"])\nend\n\nif aura_env.config[\"search_phrases\"][\"search_phrases_custom4\"] ~= \"\" then\n    table.insert(aura_env.search_list, aura_env.config[\"search_phrases\"][\"search_phrases_custom4\"])\nend\n\nif aura_env.config[\"search_phrases\"][\"search_phrases_custom5\"] ~= \"\" then\n    table.insert(aura_env.search_list, aura_env.config[\"search_phrases\"][\"search_phrases_custom5\"])\nend\n\n\n-- Generate Search String for top line\nfor index, entry in pairs(aura_env.search_list) do\n    aura_env.search_str = aura_env.search_str .. entry .. \", \"\nend\n\n\n\n",
