						["spellIds"] = {
						},
						["custom"] = "function(event, message_text, message_sender, message_language, message_channel, ...)\n    \n    -- Get name of sender without servername\n    local server_index = strfind(message_sender, \"-Firemaw\")\n    if server_index ~= nil then\n        message_sender = strsub(message_sender, 0, server_index - 1)\n    end\n    \n    -- search for instances\n    local dung_list = \"\"\n    local add_message = false\n    \n    for index, search_phrase in pairs(aura_env.search_list) do\n        if strfind(string.upper(message_text), search_phrase) ~= nil then\n            add_message = true\n            dung_list = dung_list .. search_phrase .. \" \"\n        end\n    end\n    \n    \n    -- Check for LFG\n    if aura_env.config[\"display_lfg\"] == false then\n        if strfind(string.upper(message_text), \"LFG\") ~= nil then\n            add_message = false\n        end\n    end\n    \n    -- add message to list\n    if add_message == true then\n        \n        listitem = dung_list .. \"  [\" .. message_sender .. \"]:   \" .. message_text .. \"\\n\"\n        \n        message_in_list = false\n        \n        for _,v in pairs(aura_env.message_list) do\n            if v == listitem then\n                message_in_list = true\n                break\n            end\n        end\n        \n        if message_in_list == false then\n            \n            aura_env.message_list[aura_env.message_list_index] = listitem\n            \n            if aura_env.message_list_index < aura_env.config[\"maxLineNo\"] then\n                aura_env.message_list_index = aura_env.message_list_index + 1\n                aura_env.message_list[aura_env.message_list_index] = \"- - - - - - - - - -\\n\"\n            else\n                aura_env.message_list_index = 1\n                aura_env.message_list[aura_env.message_list_index] = \"- - - - - - - - - -\\n\"\n            end\n        end\n    end\nend\n\n\n",
